import React from 'react'
import PropTypes from 'prop-types'

const Events = (props) => {
  return (
    <div>
      <ul>
        { 
          props.eventsDatas.map(event => {
            return <li>
              {event.name.text}
              {event.description.text}
              <img src={event.logo.url} alt={event.id} />
              {event.start.local}
            </li>
          })
        }
      </ul>
    </div>
  )
}

export default Events
